import React, { Component } from 'react';
import { Product } from '@bushidogames/db';

class Root extends Component {
  state = {
    products: null,
  };

  componentDidMount() {
    Product.findAll()
      .then((prod) =>
        this.setState({
          products: prod,
        }),
      )
      .catch((err) => console.log(err));
  }
  render() {
    console.log(this.state.products);
    return (
      <div>
        <h1>Hello world</h1>
      </div>
    );
  }
}

export default Root;
